  \"Environmental contaminants in piping plover, least tern, and common tern eggs
  from coastal Maine: 2003 nesting season\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  4,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:48:54.356924\",\n\t\"name\": \"environmental-contaminants-in-piping-plover-least-tern-and-common-tern-eggs-from-coastal-m\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Maine's coastal islands and beaches provide
  important nesting habitat for piping plover (Charadrius melodus), least tern (Sterna
  antillarum), and common tern (Sterna hirundo). In Maine, relatively few contaminant
  investigations have been performed with piping plover, least terns and common terns,
  and little is known about current body burdens of contaminants in these species.
  Thirty-two nonviable and abandoned eggs were collected between May and July, 2003.
  Of the 22 organochlorine compounds in the analytical scan, only five compounds were
  found in egg composite samples - dieldrin, hexachlorobenzene (HCB), total polychlorinated
  biphenyl (Total PCB), p,p'-DDE, and trans-nonachlor. Although highly elevated levels
  of organochlorine compounds and inorganic elements were not detected in these six
  egg composite samples, additional monitoring is recommended to quantify potential
  temporal and spatial contaminant trends in birds nesting along the Maine coast.\",\n\t\"license_title\":
